script: |
  super -f text -I q9706.spq | sort > q9706.out

inputs:
  - name: q9706.spq
    data: |
      SELECT col0 AS col2, + col1 - col2 FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT 94 BETWEEN - col0 AND ( - - col2 ) + - col0;
  - name: tab0

outputs:
  - name: q9706.out
    data: |
      15	34
      87	11
      97	-98
